				errn = decodeStringValue(stream, state, *qnameID, &val->str);
				moveOnID = 775; /* move on ID */
				break;
			case 2:
				*qnameID = 2;
				val->type = EXI_DATATYPE_STRING;
				errn = decodeStringValue(stream, state, *qnameID, &val->str);
				moveOnID = 775; /* move on ID */
				break;
			case 3:
				*qnameID = 191;
				val->type = EXI_DATATYPE_STRING;
				errn = decodeStringValue(stream, state, *qnameID, &val->str);
				moveOnID = 775; /* move on ID */
				break;
			case 4:
				*qnameID = 336;
				val->type = EXI_DATATYPE_STRING;
				errn = decodeStringValue(stream, state, *qnameID, &val->str);
				moveOnID = 775; /* move on ID */
				break;
			case 5:
				*qnameID = 3;
				val->type = EXI_DATATYPE_STRING;
				errn = decodeStringValue(stream, state, *qnameID, &val->str);
				moveOnID = 775; /* move on ID */
				break;
			case 6:
				*qnameID = 344;
				val->type = EXI_DATATYPE_STRING;
				errn = decodeStringValue(stream, state, *qnameID, &val->str);
				moveOnID = 775; /* move on ID */
